END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `LEDGER_TRANSACTION_DETAILS_POSTINGS_INSERT` (IN `foundation_fk` BIGINT, IN `principle_fk` BIGINT, IN `principle_groups_fk` BIGINT, IN `associate_group_fk` BIGINT, IN `tranx_type_master_fk` BIGINT, IN `balancing_method_fk` BIGINT, IN `branch_fk` BIGINT, IN `outlet_fk` BIGINT, IN `payment_status` VARCHAR(255), IN `debit` DOUBLE, IN `credit` DOUBLE, IN `transaction_date` DATE, IN `payment_date` DATE, IN `tranx_id` BIGINT, IN `tranx_type` VARCHAR(255), IN `underprefix` VARCHAR(255), IN `financial_year` VARCHAR(255), IN `created_by` BIGINT, IN `ledger_master_fk` BIGINT, IN `voucher_no` VARCHAR(255))  BEGIN
    DECLARE DBOPENING_BAL DOUBLE DEFAULT 0.0;
    DECLARE CHECKEXIST INT;
    DECLARE CHECKBALEXIST INT;
    DECLARE OPENING_BAL DOUBLE DEFAULT 0.0;
    DECLARE LEDGER_MST_ID BIGINT;
    DECLARE INSTITUTE_ID BIGINT;
    DECLARE BRANCH_ID BIGINT;
    DECLARE OUTLET_ID BIGINT;
    DECLARE DETAIL_ID BIGINT;
    DECLARE CREDIT_AMT DOUBLE DEFAULT 0.0;
    DECLARE DEBIT_AMT DOUBLE DEFAULT 0.0;
    DECLARE CLOSING_BAL DOUBLE DEFAULT 0.0;

    SET LEDGER_MST_ID = ledger_master_fk;

SELECT EXISTS (SELECT * FROM ledger_transaction_details_tbl WHERE ledger_transaction_details_tbl.ledger_master_id =ledger_master_fk and (ledger_transaction_details_tbl.branch_id = branch_fk or ledger_transaction_details_tbl.branch_id IS NULL) and ledger_transaction_details_tbl.outlet_id=outlet_fk ORDER BY ledger_transaction_details_tbl.id DESC LIMIT 1) INTO CHECKEXIST;

    IF CHECKEXIST = 0 THEN
        SELECT ledger_master_tbl.opening_bal INTO DBOPENING_BAL FROM ledger_master_tbl WHERE ledger_master_tbl.id = ledger_master_fk;
    ELSE
        SELECT ledger_transaction_details_tbl.id, ledger_transaction_details_tbl.opening_bal,ledger_transaction_details_tbl.closing_bal,ledger_transaction_details_tbl.ledger_master_id,ledger_transaction_details_tbl.branch_id,ledger_transaction_details_tbl.outlet_id INTO DETAIL_ID,OPENING_BAL,DBOPENING_BAL,LEDGER_MST_ID,BRANCH_ID,OUTLET_ID FROM ledger_transaction_details_tbl WHERE ledger_transaction_details_tbl.ledger_master_id = ledger_master_fk and (ledger_transaction_details_tbl.branch_id = branch_fk or ledger_transaction_details_tbl.branch_id IS NULL) and ledger_transaction_details_tbl.outlet_id = outlet_fk ORDER BY ledger_transaction_details_tbl.id DESC LIMIT 1;
    END IF;

    IF credit <> 0 THEN
        SET CLOSING_BAL = CAL_CR(DBOPENING_BAL,credit,0.0);

    ELSEIF debit <> 0 THEN
        SET CLOSING_BAL = CAL_DR(DBOPENING_BAL,0.0,debit);

    ELSE
        SET CLOSING_BAL = CAL_CR(DBOPENING_BAL,0.0,0.0);
    END IF;


    IF CLOSING_BAL > 0 THEN
        SET CREDIT_AMT = CLOSING_BAL;
    ELSE
        SET DEBIT_AMT = CLOSING_BAL;
    END IF;

SELECT EXISTS (SELECT * FROM ledger_balance_summary_tbl WHERE ledger_balance_summary_tbl.ledger_master_id=LEDGER_MST_ID) INTO CHECKBALEXIST;
    IF CHECKBALEXIST <> 0 THEN
  UPDATE ledger_balance_summary_tbl SET ledger_balance_summary_tbl.balance=CLOSING_BAL,ledger_balance_summary_tbl.closing_bal=CLOSING_BAL,ledger_balance_summary_tbl.credit=CREDIT_AMT,ledger_balance_summary_tbl.debit=DEBIT_AMT WHERE ledger_balance_summary_tbl.ledger_master_id=LEDGER_MST_ID;
  ELSE
  END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_SUCESSIVE_ROW_CAL_TRANX` (IN `ledger_master_id` BIGINT, IN `INOPENING_BAL` DOUBLE, IN `IN_DETAIL_ID` BIGINT)  BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE DBCREDIT DOUBLE DEFAULT 0.0;
    DECLARE DBDEBIT DOUBLE DEFAULT 0.0;
    DECLARE DBOPENING_BAL DOUBLE DEFAULT 0.0;
    DECLARE DBCLOSING_BAL DOUBLE DEFAULT 0.0;
    DECLARE DBID BIGINT DEFAULT 0;
    DECLARE DB_LEDGER_ID BIGINT DEFAULT 0;
    DECLARE CLOSING_BAL DOUBLE DEFAULT 0.0;
    DECLARE IN_OPENING_BAL DOUBLE DEFAULT 0.0;
    DECLARE IN_LEDGER_ID BIGINT;
    DECLARE CREDIT_AMT DOUBLE DEFAULT 0.0;
    DECLARE DEBIT_AMT DOUBLE DEFAULT 0.0;
    DECLARE CUR_CAL CURSOR FOR SELECT id,ledger_master_id,credit,debit,opening_bal,closing_bal FROM ledger_transaction_details_tbl WHERE ledger_transaction_details_tbl.ledger_master_id=ledger_master_id AND ledger_transaction_details_tbl.ID>IN_DETAIL_ID;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    SET IN_OPENING_BAL = INOPENING_BAL;
    SET IN_LEDGER_ID = ledger_master_id;

    OPEN CUR_CAL;

    READ_LOOP: LOOP
        FETCH CUR_CAL INTO DBID,DB_LEDGER_ID,DBCREDIT,DBDEBIT,DBOPENING_BAL,DBCLOSING_BAL;
        IF done THEN
            LEAVE read_loop;
        END IF;

        IF DBCREDIT <> 0 THEN
            SET CLOSING_BAL = CAL_CR(IN_OPENING_BAL,DBCREDIT,0.0);

        ELSEIF DBDEBIT <> 0 THEN
            SET CLOSING_BAL = CAL_DR(IN_OPENING_BAL,0.0,DBDEBIT);

        ELSE
            SET CLOSING_BAL = CAL_CR(IN_OPENING_BAL,0.0,0.0);
        END IF;

        UPDATE ledger_transaction_details_tbl SET ledger_transaction_details_tbl.opening_bal=IN_OPENING_BAL,ledger_transaction_details_tbl.closing_bal=CLOSING_BAL WHERE ledger_transaction_details_tbl.id=DBID;
        SET IN_OPENING_BAL = CLOSING_BAL;

    END LOOP READ_LOOP;


    CLOSE CUR_CAL;

    IF IN_OPENING_BAL > 0 THEN
        SET CREDIT_AMT = IN_OPENING_BAL;
    ELSE
        SET DEBIT_AMT = IN_OPENING_BAL;
    END IF;

    UPDATE ledger_balance_summary_tbl SET ledger_balance_summary_tbl.balance=IN_OPENING_BAL,ledger_balance_summary_tbl.closing_bal=IN_OPENING_BAL,ledger_balance_summary_tbl.credit=CREDIT_AMT,ledger_balance_summary_tbl.debit=DEBIT_AMT WHERE ledger_balance_summary_tbl.ledger_master_id=IN_LEDGER_ID;


END$$

--
-- Functions
--
CREATE DEFINER=`root`@`localhost` FUNCTION `CAL_CR` (`OPENING_BAL` DOUBLE, `CREDIT` DOUBLE, `DEBIT` DOUBLE) RETURNS DOUBLE BEGIN
    RETURN OPENING_BAL-DEBIT+CREDIT;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `CAL_DR` (`OPENING_BAL` DOUBLE, `CREDIT` DOUBLE, `DEBIT` DOUBLE) RETURNS DOUBLE BEGIN
    RETURN OPENING_BAL+DEBIT-CREDIT;
END$$

